import React, { useEffect, useState } from "react";
import { fetchStudents } from "../api/adminApi";

const StudentList = () => {
  const [students, setStudents] = useState([]);

  useEffect(() => {
    const fetchStudents = async () => {
      try {
        // Fetch students, pass token if needed
        const token = localStorage.getItem("adminToken"); // Assuming token is saved in localStorage
        const response = await listStudents(token);
        setStudents(response.data); // Use response.data to access the actual data
      } catch (error) {
        console.error("Failed to fetch students:", error);
        alert("Error fetching students");
      }
    };

    fetchStudents();
  }, []);

  return (
    <div>
      <h2>Student List</h2>
      <ul>
        {students.map((student) => (
          <li key={student.id}>{student.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default StudentList;
